import React, { Component, Fragment } from 'react'
import {Route, NavLink, Redirect} from 'react-router-dom'
import Chart from './Ticker/Chart'
import Summary from './Ticker/Summary'
import Statistic from './Ticker/Statistic'
import '../styles/style.css';
import '../styles/dash.css';

export default class Lookup extends Component {
    render() {
        let secondRouteList = [
            /*<Route exact path="/dashboard/lookup" render={(props)=><Redirect to="/dashboard/lookup/summary"/>}/>,*/
            <Route exact path="/dashboard/lookup/summary"  component={Summary}/>,
            <Route exact path="/dashboard/lookup/chart"  render={(props)=>
              <Chart chartsTicker={this.state.chartsTicker} {...props} />}/>,
            <Route exact path="/dashboard/lookup/statistic"  render={(props)=>
              <Statistic chartsTicker={this.state.chartsTicker} {...props} />}/>,
          ]
        return (
            
                <Fragment>
                <div className="navheader">
                        navheader
                        <div>
                            <NavLink
                                exact to="/dashboard/lookup/summary"
                                style={{textDecoration:"none", color:"rgb(28, 104, 243)"}}
                                >Summary
                            </NavLink>
                        </div>
                </div>
                <div>
                    hello lookup
                    {secondRouteList}
                </div>
                </Fragment>
               
            
        )
    }
}
